(49, 44, 140, 1, 1, 10, 10000, 1, 'http://assets.yilep.com/upload/img/16951/180720/1f7a4b92a60b8fe7f5222eb143261605.jpg', '快手直播粉丝', '个', 0.029786, 1.3, 1.2, 1.1, 0, '<p><strong><span style=\"font-family:\'宋体\', SimSun;\"><span style=\"font-size:18px;color:#ff0000;\">如何获取快手ID：</span> <br><span style=\"color:#00b050;\">1.有权限的下单前 先进入个人主页-点击“编辑”-“私有用户”关闭不要打开即可。</span><br><span style=\"color:#00b050;\">2.获取快手ID教程，进入快手，点击你的头像，点击编辑个人资料、用户编号就是快手ID。</span><br><span style=\"color:#00b050;\">3.不会找快手ID和作品ID的，我们提供了链接模式，您可以使用链接模式下单</span><br></span></strong></p><p><span style=\"font-size:16px;\"><strong><span style=\"font-family:\'宋体\', SimSun;color:#ff0000;\">切勿同时下单其他不同名称的快手粉丝，否则不售后！</span></strong></span></p><p><span style=\"font-size:16px;\"><strong><span style=\"font-family:\'宋体\', SimSun;color:#ff0000;\">速度下单就秒，日刷5万左右，掉量不补，介意勿下！</span></strong></span></p><p><span style=\"color:rgb(229,51,51);\"><span style=\"color:rgb(229,51,51);\"><span style=\"color:rgb(128,0,255);background-color:rgb(255,255,0);font-family:\'宋体\', SimSun;font-size:16px;\"><strong>┈═ ☆ 下错ID的直接点退单即可-全天24小时自助退单 ☆ ═┈</strong></span></span></span></p>', '2019-01-29 16:26:36', 23, 38213, NULL, 'NULL', 'dyid', 'NULL', 'NULL', 'NULL', 0, 20, 325, 1, 1, 0, NULL, NULL),
(49, 44, 140, 1, 1, 30, 100, 1, 'http://assets.yilep.com/upload/img/16951/180416/d0c40b509ea7a657de10a93399242943.jpg', '快手直播人气', '个', 0.033496, 1.3, 1.2, 1.1, 0, '<p><strong><span style=\"color:#00b050;\"><span style=\"font-size:16px;\"> 直播人气只能稳定在90+左右 自带也算进去 因人气直播不稳定,最低下单30 最高下单100 防止卡单问题</span><span style=\"font-size:16px;\">可在下单后在开启直播，下单维持4小时 24小时下单秒上人！</span></span></strong><br></p><p><span style=\"font-size:15px;\"><strong><span style=\"font-weight:700;\"><span style=\"font-size:16px;\"><strong><span style=\"color:#ff0000;\">温馨提示：必须关闭隐私用户，如果开播后一直不进人的请检查隐私用户是否打开！</span></strong></span></span></strong></span></p>', '2019-01-29 16:31:09', 23, 38214, NULL, 'NULL', 'kszpid', 'NULL', 'NULL', 'NULL', 0, 20, 326, 1, 1, 0, NULL, NULL),
(49, 44, 140, 1, 1, 10, 100000, 1, 'http://assets.yilep.com/upload/img/16951/180416/03ef72c3c5f6ff1f4de29250a1ed6fca.jpg', '快手随机评论', '个', 0.017066, 1.3, 1.2, 1.1, 0, '<p><span style=\"color:#009900;font-size:16px;\"><strong>如何获取快手id 作品id : <br>进入快手作品-点击分享按钮-复制链接-从链接中取出用户ID和作品ID（userId=用户ID photoId=作品ID）<br>比如：<br>huserId=44158817      快手ID就是：44158817<br>photoId=1687383010    作品ID就是：1687383010<br>不会找快手ID和作品ID的，我们提供了链接模式下单<br>==========================================<br></strong></span><span style=\"color:#E53333;font-size:14px;\"><strong>[快手评论业务] 小号都有头像昵称，高仿真人号，评论内容随机（例如支持、666等类似评论）！ <br>[快手评论业务] 作品不能设置私密，必须设置所有人可以评论，没开始刷的都是这个问题的！ <br>快手ID和作品ID不要写错，写错的刷不了，而且请不要设置为私密作品！下单前请务必检查下！</strong></span></p>', '2019-01-29 16:31:14', 23, 38212, NULL, 'NULL', 'kszpid', 'NULL', 'NULL', 'NULL', 0, 20, 327, 1, 1, 0, NULL, NULL),
(49, 44, 140, 1, 1, 10, 1000, 1, 'http://ww2.sinaimg.cn/large/007yLfDNly1fz9m00pr9ij30n10t4abq.jpg', '快手热评点赞', '个', 0.054, 1.3, 1.2, 1.1, 0, '<p><span style=\"color:#ff0000;font-size:18px;font-family:\'宋体\', SimSun;\"><strong>快手热评点赞介绍：</strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#00b050;\"><strong><span style=\"font-size:16px;\">下单链接：填写需要评论的作品链接</span></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#00b050;\"><strong><span style=\"font-size:16px;\">备注信息：填写您自己的快手id（字母和数字都可以）</span></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#00b050;\"><strong><span style=\"font-size:16px;\">下单数量：填写您需要代刷的数量</span></strong></span></p><p><span style=\"color:rgb(255,0,0);\"><strong><span style=\"font-size:16px;font-family:\'宋体\', SimSun;\"><span style=\"text-decoration:underline;\">关于为什么刷不了的问题：</span></span></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#7030a0;\"><strong><span style=\"font-size:16px;\">你的评论是敏感字，快手官方给屏蔽掉了，这种刷不了您上另外一个账户去看看就知道有没有被屏蔽掉。</span></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#7030a0;\"><strong><span style=\"font-size:16px;\">正常的评论是不会被屏蔽掉的，需要做引流的自己研究好评论的词在发吧！敏感字是不会显示的哦！</span></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#7030a0;\"><strong><span style=\"font-size:16px;\">也不是百分之百置顶，每个人评论的内容不同，明显广告，色情，低俗的都不行只包点赞上去，内容您自己测试！</span></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#00b050;font-size:16px;\"><strong></strong></span></p><p><span style=\"font-family:\'宋体\', SimSun;color:#ff0000;\"><strong><span style=\"font-size:16px;\">注意事项：请您下单之后在去评论作品哦！以防大网红作品查询不到评论！</span></strong><strong><span style=\"font-size:16px;\">请务必按照一下格式下单哦！</span></strong></span></p>', '2019-01-29 16:31:19', 23, 295386, NULL, 'NULL', 'kszpid', 'NULL', 'NULL', 'NULL', 0, 20, 328, 1, 1, 0, NULL, NULL),
