(55, 5, 198, 0, 0, 10, 10000, 1, 'http://assets.yilep.com/upload/images/77095/77095/201809/13/4452770ce24f9a7e513c76a7d00c9256.png', '秒刷自定说说评论', '个', 0.003723, 0, 0, 0, 0, '<p style=\"color:rgb(51,51,51);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(255,229,0);\">自定义说说评论公告：</span></p><p style=\"color:rgb(51,51,51);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;\"><span style=\"color:rgb(0,0,0);font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">①.空间必须为所有人可以访问（空间被封的请勿下单）</span></p><p style=\"color:rgb(51,51,51);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;\"><span style=\"color:rgb(0,0,0);font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">②.说说必须允许让陌生人评论（请勿开启评论审核，认证空间请勿下单） </span></p><p style=\"color:rgb(51,51,51);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;\"><span style=\"color:rgb(0,0,0);font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">③.不能确定的您可以用一个小号测试一下（这个小号必须为非好友关系）如果有权限您不会关闭，可以下单在备注里填上您的QQ密码，让我们为您关闭（必须关闭网页登录保护哦！） </span></p><p style=\"color:rgb(51,51,51);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;\"><span style=\"color:rgb(0,0,0);font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">④.评论内容不可以带敏感词，比如卡盟，网址，色情，刷钻赞等。</span></p><p style=\"color:rgb(51,51,51);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;\"><span style=\"color:rgb(0,0,0);font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">------ 自定义说说评论，真人号码代刷，评论不掉，全网独家，日刷2W------</span></p><p style=\"font-family:Raleway, sans-serif;font-size:13px;\">中途禁止删除说说，删除判断该订单为完成 并且不补</p><p style=\"font-family:Raleway, sans-serif;font-size:13px;\">评论内容请勿带有任何违规字词，否则直接完成，不退款不售后。</p><p style=\