(55, 5, 198, 0, 0, 50, 100000000, 1, 'http://assets.yilep.com/upload/images/77095/77095/201809/13/4fb0bee1341aacb8f3978461442aae58.png', '快刷说说点赞', '个', 0.002123, 0, 0, 0, 0, '<p>空间说说赞下单秒 ，下单必须允许所有人访问空间！</p>', '2019-03-01 21:03:50', 52, 185302, 1, '1', 'uin', NULL, NULL, NULL, 0, 33, 1098, 0, NULL, NULL, NULL, NULL),
(55, 5, 198, 0, 0, 10, 100000, 1, 'http://assets.yilep.com/upload/images/77095/77095/201809/24/d6f503f30b490f33a2fc66e09c2ae090.png', '秒刷说说点赞', '个', 0.002035, 0, 0, 0, 0, '<p><span style=\"color:#009900;font-size:14px;\"><strong> 刷说说赞怎么打开权限？<br>方法如下：<br>1.首先登录手机QQ，找出设置选项。<br>2.点击设置以后，找出最基本的相关功能，也就是联系人与隐私。<br></strong></span></p><p>\n	<span style=\"color:#009900;font-size:14px;\"><strong> 3.查看权限与隐私一目了然，直接打开：“动态权限设置”，</strong></span></p><p>\n	<span style=\"color:#009900;font-size:14px;\"><strong>    “谁能看我的空间”和“谁能看我的访客”点击进去选择：“公开，所有人”即可。</strong></span></p><p><span style=\"color:#009900;font-size:14px;\"><strong> 4.发说说时下面有个：“谁能看见”，点击进去选择：“所有人”即可。<br>==========================================<br></strong></span> </p><p>\n	<span style=\"color:#E53333;font-size:18px;\"><strong> 注意事项：</strong></span> </p><p>\n	<span style=\"color:#E53333;font-size:18px;\"><strong></strong></span><span style=\"font-family:Raleway, sans-serif;font-size:13px;background-color:rgba(112,193,179,.1);\">日刷2万左右</span><br><span style=\"font-family:Raleway, sans-serif;font-size:13px;background-color:rgba(112,193,179,.1);\">1.下单前注意：下单说说赞空间必须开放所有人，未刷完之前禁止关闭空间删除说说。</span><br><span style=\"font-family:Raleway, sans-serif;font-size:13px;background-color:rgba(112,193,179,.1);\">2.请务必确保空间和说说权限公开所有人且空间未被封；转发说说可以刷</span><span style=\"color:#E53333;font-size:18px;\"><strong></strong></span></p>', '2019-03-01 21:03:50', 52, 185303, 1, '1', 'uin', NULL, NULL, NULL, 0, 33, 1099, 0, NULL, NULL, NULL, NULL),
(55, 5, 198, 0, 0, 10, 1000000, 1, 'http://assets.yilep.com/upload/images/77095/77095/201809/13/cbaf8d11e339f7e0a608379b602b23d1.png', '特价说说点赞', '个', 0.001805, 0, 0, 0, 0, '<p><span style=\"color:rgb(0,153,0);font-size:14px;\"><strong> 刷说说赞怎么打开权限？<br>方法如下：<br>1.首先登录手机QQ，找出设置选项。<br>2.点击设置以后，找出最基本的相关功能，也就是联系人与隐私。<br>3.查看权限与隐私一目了然，直接打开：“动态权限设置”，“谁能看我的空间”和“谁能看我的访客”点击进去选择：“公开，所有人”即可。<br>4.发说说时下面有个：“谁能看见”，点击进去选择：“所有人”即可。<br>==========================================<br></strong></span> </p><p>\n	<span style=\"color:rgb(229,51,51);font-size:18px;\"><strong> 注意事项：</strong></span></p><p><span style=\"color:rgb(229,51,51);font-size:18px;\"><strong></strong></span><span style=\"font-family:Arial;\"><span style=\"color:rgb(102,102,102);font-family:Raleway, sans-serif;font-size:13px;font-style:normal;font-weight:400;background-color:rgba(112,193,179,.1);\"></span></span></p><p style=\"font-family:\'微软雅黑\', \'宋体\';font-size:12px;color:rgb(51,51,51);\"><span style=\"font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">QQ空间允许任何人访问，目前下单秒刷，日刷几千性价比最高的说说赞</span><span style=\"font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">【一个QQ号码禁止多家重复下单】</span></p><p style=\"font-family:\'微软雅黑\', \'宋体\';font-size:12px;color:rgb(51,51,51);\"><span style=\"font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">下单前注意：转发说说可以刷</span><span style=\"font-family:Arial;font-size:16px;background-color:rgb(255,229,0);\">，空间开放，未刷完之前禁止关闭空间删除说说。删除说说，一律由买家自行承担，</span></p><p><span style=\"font-family:Arial;\"><span style=\"color:rgb(102,102,102);font-family:Raleway, sans-serif;font-size:13px;font-style:normal;font-weight:400;background-color:rgba(112,193,179,.1);\"></span></span><span style=\"color:rgb(229,51,51);font-size:18px;\"><strong></strong></span><br></p>', '2019-03-01 21:03:50', 52, 185301, 1, '1', 'uin', NULL, NULL, NULL, 0, 33, 1097, 0, NULL, NULL, NULL, NULL),
