(74, 1, 284, 0, 0, 10, 1000000, 1, 'http://img.yilep.com/upload/images/120562/120562/201905/16/f42348a2d02689f7257a68ea8e45a5b0.gif!yile', '快手分类评论', '个', 0.0233, 1, 1, 1, 0, '<p>1.快手ID:我的主页-编辑个人资料-用户编号就是你的ID.请认真填写ID！\n2.权限设置:进入个人主页-点击“编辑个人资料”-“隐私用户”关闭掉 不要打开 中途关闭不负责！\n3.举例比如http://www.gifshow.com/i/photo/lwx?userId=1XPaCXnlajP7KM6knP8SQTjQ&amp;photoId=1XYbUaSReeL-tUWYsWAb4WLQ×tamp=1523262674240&amp;cc=share_copylink&amp;et=1_a%2F1597256676836282368_f0&amp;fid=807219306 快手id就是1XPaCXnlajP7KM6knP8SQTjQ 作品id就是1XYbUaSReeL-tUWYsWAb4WLQ\n4.速度日刷20万，支持重复下单！</p>', '2019-06-26 18:29:10', 0, NULL, 1, '1', '', '', '', '', 0, 37, 2269, 0, 1, 0, NULL, NULL);
