(86, 5, 313, 0, 0, 1, 10, 1, 'http://img.yilep.com/ylsq/images/noimg.jpg', '好策网课代看', '个', 6.18, 6.18, 6.18, 6.18, 0, '<p><span style=\"font-size:12px;color:rgb(0,176,80);\"><span style=\"font-weight:700;\">请根据代看门数选择对应的下单份数，多门课名下单请用，隔开。</span></span></p><p><span style=\"font-size:12px;color:rgb(255,0,0);\"><span style=\"font-weight:700;\">例如：某个网课 有6门课程要下单填写网课登录账号和密码，课程内容写：课程1，课程2，课程3，课程4，课程5，课程6 然后下单数量也是 6，课程填写了几门，下单数量也必须一致</span></span></p><p><span style=\"font-size:12px;color:rgb(0,176,80);\"><span style=\"font-weight:700;\">下单后2-3天看完一个门数，由代看门数决定，最迟5天 </span></span></p><p><span style=\"font-weight:700;color:rgb(0,176,80);\"><span style=\"font-size:12px;\">下单后请不要上号查看，不要修改密码，否者一切后果自负 </span></span></p><p><span style=\"font-size:12px;color:rgb(0,176,80);\"><span style=\"font-weight:700;\">下单前请再三确定您输入的账号密码正确并可以登录(不可使用默认登陆密码,例如 123456)</span></span></p><p><span style=\"font-size:12px;color:rgb(0,176,80);\"><span style=\"font-weight:700;\"><span style=\"color:rgb(49,112,143);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;text-align:center;\"><span style=\"font-size:16px;color:rgb(229,51,51);\">所有单子,中途改密,默认已完成,一律不补单.不退款</span></span></span></span></p><p><span style=\"font-size:12px;color:rgb(0,176,80);\"><span style=\"font-weight:700;\">由于课程是分时间段开放，请客户自行检查，比如下单6门课程，但是当时只开课了3门，还有3门没有开课，那么供货商只会代看已经开课的，还有几门未开课的请客户在开课后通知客服补单后续开课的课程（不要提前，必须是开课后通知）</span></span></p><p><span style=\"font-weight:700;\"><span style=\"color:rgb(255,0,0);\"></span></span><span style=\"font-weight:700;color:rgb(49,112,143);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;text-align:center;\"><span style=\"font-size:16px;color:rgb(229,51,51);\">好策阅读支持书籍：穷爸爸富爸爸、时间简史、追风筝的人、鲁滨逊漂流记、简爱。成绩85-90分。APP阅读时间10小时</span></span><span style=\"font-weight:700;color:rgb(49,112,143);font-family:\'微软雅黑\', \'宋体\', \'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:12px;text-align:center;\"><span style=\"font-size:16px;color:rgb(229,51,51