(104, 14, 331, 0, 0, 10, 1000, 1, 'http://img.yilep.com/upload/images/120562/120562/201905/16/a50f9fc904487b6754ab6b4c7a9a3359.gif!yile', '快刷快手热评点赞', '个', 0.029028, 0.029028, 0.029028, 0.029028, 0, '<p><span style=\"color:rgb(0,0,0);background-color:rgb(255,229,0);\"><strong>注意事项：请您下单之后在去评论作品哦！以防大网红作品查询不到评论！</strong></span> </p><p><span style=\"color:rgb(0,0,0);background-color:rgb(255,229,0);\"><strong>请务必按照一下格式下单哦！</strong></span> </p><p><span style=\"color:rgb(0,0,0);background-color:rgb(0,213,255);\"><strong>下单链接：填写需要评论的作品链接</strong></span> </p><p><span style=\"color:rgb(0,0,0);background-color:rgb(0,213,255);\"><strong>备注信息：填写发布这条评论用户的快手id（字母和数字都可以）</strong></span> </p><p><span style=\"color:rgb(0,0,0);background-color:rgb(0,213,255);\"><strong>数量：      填写您需要代刷的数量</strong></span> </p><p><span style=\"color:rgb(0,0,0);background-color:rgb(255,229,0);\"><strong>关于为什么刷不了的问题：</strong></span> </p><p><span style=\"color:rgb(76,51,229);background-color:rgb(255,229,0);\"><strong>      你的评论是敏感字，快手官方给屏蔽掉了，这种刷不了您上另外一个账户去看看就知道有没有被屏蔽掉。</strong></span> </p><p><span style=\"color:rgb(76,51,229);background-color:rgb(255,229,0);\"><strong>      正常的评论是不会被屏蔽掉的，需要做引流的自己研究好评论的词在发吧！敏感字是不会显示的哦！</strong></span> </p><p><span style=\"color:rgb(76,51,229);background-color:rgb(255,229,0);\"><strong>      也不是百分之百置顶，每个人评论的内容不同，明显广告，色情，低俗的都不行只包点赞上去，内容您自己测试！</strong></span></p><p><br></p>', '2019-06-29 19:31:51', 86, 322972, 1, '1', 'ksid', NULL, NULL, NULL, 1, 56, 3140, 0, NULL, 0, NULL, NULL),
