(167, 3, 457, 0, 0, 10, 10000000, 1, 'http://img.yilep.com/upload/img/1328/180331/b1638bbdffd11408b5d4f6cf50ab4677.jpg!yile', '快手直播爱心', '个', 0.500479, 0.5, 0.45, 0.35, 0, '<p>下单填写快手ID即可，快手ID在用户资料里！\n直播间点亮增加左上角爱心数量，下单秒刷日刷100万！\n需要在直播间开播期间下单，未在直播情况下无法点亮直播间爱心！</p>', '2019-08-01 06:25:39', NULL, 50703, 1, '0', 'ksid', 'zpid', NULL, NULL, 0, 74, 5676, 0, 1, 0, 'ksid', NULL),
(167, 3, 457, 0, 0, 20, 100, 1, 'http://img.yilep.com/upload/img/1328/180331/908324012fc8cdb08dca50ffc5c6e2c6.jpg!yile', '快手直播人气', '个', 0.523225, 0.5, 0.45, 0.35, 0, '<p>快手严重限制，导致上人数有些限制，目前已经优化，上人数暂定50-100人！\n4小时内无条件全自动补单，超过时间久不支持补单哦，稳定不掉。打造真实效果！\n特别注意：请确定好再下单，下单后无法退单，请一次性下够数量，中途不要重复下单，会导致掉人气</p>', '2019-08-01 06:25:39', NULL, 50705, 1, '0', 'ksid', 'zpid', NULL, NULL, 0, 74, 5677, 0, 1, 0, 'ksid', NULL),
(167, 3, 457, 0, 0, 10, 30000, 1, 'http://img.yilep.com/sina/007yLfDNly1fzd3af6oiqj305k06yjrt.jpg!yile', '快手真人评论赞', '个', 0.54335, 0.5, 0.45, 0.35, 0, '<p><span style=\"font-weight:700;color:rgb(0,102,0);font-family:\'微软雅黑\', \'宋体\', \'helvetica neue\', Helvetica, Arial, sans-serif;font-size:14px;\"></span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(255,229,0);\">注意事项：请您下单之后在去评论作品哦！以防大网红作品查询不到评论！</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(255,229,0);\">请务必按照一下格式下单哦！</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(0,213,255);\">下单链接：填写需要评论的作品链接</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(0,213,255);\">备注信息：填写您自己的快手id（字母和数字都可以）</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(0,213,255);\">数量：      填写您需要代刷的数量</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(0,0,0);background-color:rgb(255,229,0);\">关于为什么刷不了的问题：</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(76,51,229);background-color:rgb(255,229,0);\">      你的评论是敏感字，快手官方给屏蔽掉了，这种刷不了您上另外一个账户去看看就知道有没有被屏蔽掉。</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(76,51,229);background-color:rgb(255,229,0);\">      正常的评论是不会被屏蔽掉的，需要做引流的自己研究好评论的词在发吧！敏感字是不会显示的哦！</span></p><p style=\"color:rgb(51,51,51);text-align:center;\"><span style=\"font-size:16px;color:rgb(76,51,229);background-color:rgb(255,229,0);\">      也不是百分之百置顶，每个人评论的内容不同，明显广告，色情，低俗的都不行只包点赞上去，内容您自己测试！</span></p>', '2019-08-01 06:25:39', NULL, 297748, 1, '0', 'ksid', 'zpid', NULL, NULL, 0, 74, 5678, 0, 1, 0, 'ksid', NULL),
